    final ArrayList<String> schemes = mDataSchemes;
    int match = MATCH_CATEGORY_EMPTY;
    if (types == null && schemes == null) {
        return ((type == null && data == null) ? (MATCH_CATEGORY_EMPTY + MATCH_ADJUSTMENT_NORMAL) : NO_MATCH_DATA);
