    int e = bits & 0x7fff;
    int result = bits;
    if (e < 0x3c00) {
        result &= FP16_SIGN_MASK;
        result |= 0x3c00 & -(~(bits >> 15) & (e != 0 ? 1 : 0));
    } else if (e < 0x6400) {
        e = 25 - (e >> 10);
        int mask = (1 << e) - 1;
        result += mask & ((bits >> 15) - 1);
        result &= ~mask;
    }
